INSERT INTO page_properties VALUES (346, 32, 'body', '<P>V tejto časti máte možnosť získať informácie o práve obsadzovaných pracovných miestach v našej spoločnosti. V prípade Vášho záujmu o zobrazenú pozíciu pošlite email s presným názvom pozície na <A href="mailto:emmi@inter.emm.sk">emmi@inter.emm.sk</A>. Ak máte záujem pracovať v našej spoločnosti, ale žiadna zo zobrazených pozícií Vás neoslovila, pošlite svoj životopis s popisom pozície, na ktorej by ste chceli pracovať na <A href="mailto:emmi@inter.emm.sk">emmi@inter.emm.sk</A>.<BR><BR>Odoslaním údajov uvedených v emaily budete zaradený do personálnej databázy. V prípade, že Váš profil bude zodpovedať naším požiadavkám na vhodného kandidáta, pozveme Vás na osobný pohovor.</P>
