INSERT INTO page_properties VALUES (172, 96, 'body', '<BR>Mať prehľad o aktuálnom stave bezpečnosti informačného systému a vedieť dôkladne vyšetriť bezpečnostné incidenty. To sú aktuálne výzvy pre manažérov bezpečnosti ...<BR><BR>Plnú verziu článku si môžete prečítať <A href="http://netadmin.emm.office.netropolis.sk/pics/upload/users/admin/File/DSM_masny.pdf" target=_blank>tu</A>.');
INSERT INTO page_properties VALUES (173, 97, 'body', '<STRONG><BR></STRONG>Dňa 23. mája 2006 sa v Hoteli Holiday Inn Bratislava bude konať seminár CA EITM Day 2006, ktorého partnerom je naša spoločnosť EMM, spol. s r.o.<BR><BR>Počas seminára budú účastníci oboznámení s novou koncepciou Enterprise IT Management - EITM. Táto je založená na zjednocovaní a zjednodušovaní riadenia celopodnikových informačných technológií (IT). Cieľom je zaistiť maximálnu návratnosť firemných investícií do IT a prispôsobiť IT zdroje podnikateľským potrebám organizácie. Zároveň umožňuje získať väčšiu kontrolu nad nákladmi, lepšie optimalizovať úrovne služieb, riadiť riziká a prispôsobiť IT investície podnikateľským aktivitám.<BR><BR>Viac informácií na <A href="http://www.ca.com/offices/czechslovak/local/eitmday/bratislava/" target=_blank>stránke CA</A>. <BR>');
