INSERT INTO page_properties VALUES (163, 90, 'body', '<P><STRONG>Bezpečnosť VoIP<BR></STRONG>IP telefónia je technológia, ktorá sa čoraz viac dostáva do popredia v oblasti digitálneho spracovania a prenosu hlasu. Jednou z nesporných výhod tohto riešenia je zníženie prevádzkových nákladov. Disponuje nástrojmi, ktoré bežná telefónna sieť nedokáže poskytnúť. Moderné zariadenia prinášajú úplne nové, doteraz ťažko dostupné služby, typické len pre tento spôsob. Všeobecným trendom je konvergencia dát, hlasu, obrazu do jednotného, ktoré nazývame multimediálny obsah (multimedia content), pričom cieľom je prenášať všetko po jednej sieti.</P>');
INSERT INTO page_properties VALUES (164, 91, 'body', '<STRONG>Monitoring a forenzná analýza</STRONG><BR>Mať prehľad o aktuálnom stave bezpečnosti informačného systému a vedieť dôkladne vyšetriť bezpečnostné incidenty. To sú aktuálne výzvy pre manažérov bezpečnosti ...<BR><BR>Plnú verziu článku si môžete prečítať <A href="/pics/upload/users/admin/File/DSM_masny.pdf" target=_blank>tu</A>.');
INSERT INTO page_properties VALUES (165, 89, 'body', '<P><B>Čipové karty v Lotus Notes</B><BR>SCDisc je produkt, ktorý rozširuje možnosti natívnej podpory čipových kariet v Lotus Notes. Jeho prínosom je umiestnenie celého ID súboru na čipovú kartu a zabezpečenie prenositeľnosti pri práci na rôznych PC. Pomocou ďalších nástrojov zabezpečuje komplexnú správu čipových kariet v systéme Lotus Notes.<BR></P>');
INSERT INTO page_properties VALUES (170, 94, 'body', '<P><BR>SCDisc je produkt, ktorý rozširuje možnosti natívnej podpory čipových kariet v Lotus Notes. Jeho prínosom je umiestnenie celého ID súboru na čipovú kartu a zabezpečenie prenositeľnosti pri práci na rôznych PC. Pomocou ďalších nástrojov zabezpečuje komplexnú správu čipových kariet v systéme Lotus Notes.<BR></P>');
INSERT INTO page_properties VALUES (171, 95, 'body', '<P><STRONG><BR></STRONG>IP telefónia je technológia, ktorá sa čoraz viac dostáva do popredia v oblasti digitálneho spracovania a prenosu hlasu. Jednou z nesporných výhod tohto riešenia je zníženie prevádzkových nákladov. Disponuje nástrojmi, ktoré bežná telefónna sieť nedokáže poskytnúť. Moderné zariadenia prinášajú úplne nové, doteraz ťažko dostupné služby, typické len pre tento spôsob. Všeobecným trendom je konvergencia dát, hlasu, obrazu do jednotného, ktoré nazývame multimediálny obsah (multimedia content), pričom cieľom je prenášať všetko po jednej sieti.</P>');
