INSERT INTO page_properties VALUES (392, 13, 'body', '<H2>Systém kontroly vstupov</H2>
INSERT INTO page_properties VALUES (401, 26, 'body', '<P align=center><SPAN class=nad_blue><IMG height=80 src="https://netadmin.inter.emm.sk/pics/upload/users/admin/Image/onas/logo_EMMi.jpg" width=80>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </SPAN></P>
INSERT INTO page_properties VALUES (403, 120, 'body', '<P>EMM International sa špecializuje na dodávky komponentov a komplexných riešení v širokom spektre ponúkaných systémov a aplikácií. Obchodné oddelenie je pripravené promptne reagovať na potreby klientov :</P>
INSERT INTO page_properties VALUES (416, 121, 'body', '<H2>Systém kontroly vstupov</H2>
INSERT INTO page_properties VALUES (417, 122, 'body', '<H1>Dochádzkový systém (DS)</H1>
INSERT INTO page_properties VALUES (421, 3, 'body', '<P>V tejto sekcii môžete nájsť bližšie informácie o ponúkaných a&nbsp;realizovaných systémoch od spoločnosti EMM International spol s r.o.&nbsp;</P>
INSERT INTO page_properties VALUES (425, 20, 'body', '<P>&nbsp;</P>');
INSERT INTO page_properties VALUES (428, 27, 'body', '<P align=center><A href="http://www.emm.sk"></A></P>
INSERT INTO page_properties VALUES (430, 115, 'body', '<P>&nbsp;</P>');
INSERT INTO page_properties VALUES (438, 110, 'body', '<BR><BR><IMG height=185 alt="Nová budova" src="http://www.emm.sk/pics/novinky/2006/budova.jpg" width=200 align=left vspace=20> Spoločnosť EMM International, spol. s r.o. dňa 3. októbra 2006 zmenila svoje sídlo a presťahovala sa do nových priestorov, ktoré sa nachádzajú v Bratislave - Dúbravke.<BR><BR><B>Nová adresa spoločnosti je</B>:<BR><BR>EMM International, spol. s r.o.<BR>Sekurisova 16<BR>841 02 Bratislava 42<BR><BR><STRONG>Telefón a fax:<BR></STRONG>tel.: + 421 (2) 65 311 915<BR>fax: + 421 (2) 65 311 884<BR><BR><A href="mailto:emmi@inter.emm.sk">emmi@inter.emm.sk</A><BR><A href="http://www.emminter.sk" target=_blank>www.emminter.sk</A>');
INSERT INTO page_properties VALUES (448, 12, 'body', '<H2>Systém priemyselnej televízie (PTV)</H2>
INSERT INTO page_properties VALUES (450, 126, 'body', '<H1>Systém priemyselnej televízie (PTV)</H1>
INSERT INTO page_properties VALUES (451, 125, 'body', '<P class=MsoBodyText style="MARGIN: 0in 0in 0pt"><SPAN lang=SK><FONT size=3>Výrobky firmy bpt sú už viac než 50 rokov neodmysliteľnou súčasťou našich domovov. Bpt ponúka technologicky pokrokové produkty, s&nbsp;vysokými technickými parametrami, jednoducho ovládateľné, s&nbsp;originálnymi nevtieravými tvarmi. Firma presadzuje spojenie náročnej techniky s talianskym dizajnom, ktoré spolu vytvárajú jednoduchosť a krásu.</FONT></SPAN></P>
INSERT INTO page_properties VALUES (452, 127, 'body', '<H2 style="MARGIN: auto 0in"><SPAN style="FONT-FAMILY: Arial">Riadenie manažmentu bezpečnostných systémov - WINMAG</SPAN></H2>
INSERT INTO page_properties VALUES (482, 8, 'body', '<P>Produkty talianskej spoločnosti Bpt SpA sú už viac než 50 rokov neodmysliteľnou súčasťou<IMG height=225 hspace=10 src="/pics/upload/users/admin/Image/bpt.png" width=225 align=right> moderných domácností. Bpt ponúka technologicky pokrokové produkty s vysokými technickými parametrami, jednoducho ovládateľné, s originálnymi nevtieravými tvarmi. Firma presadzuje spojenie náročnej techniky s talianskym dizajnom, ktorý spája jednoduchosť a krásu. </P>
INSERT INTO page_properties VALUES (484, 9, 'body', '<H1>Systém priemyselnej televízie (PTV)</H1>
INSERT INTO page_properties VALUES (485, 111, 'body', '<P>V prípade akýchkoľvek pripomienok týkajúcich sa našej internetovej stránky píšte prosím na e-mail: <A href="mailto:support@inter.emm.sk">support@inter.emm.sk</A></P>
INSERT INTO page_properties VALUES (486, 123, 'body', '<H2>Elektrická požiarna signalizácia (EPS)</H2>
INSERT INTO page_properties VALUES (487, 10, 'body', '<P>Technická bezpečnosť je hlavnou doménou EMM International. Na Slovensku patríme k najúspešnejším spoločnostiam v tomto segmente trhu. Od roku 1991 aktívne spolupracujeme s renomovanými svetovými výrobcami formou vzájomnej výmeny informácií a odborných návštev. <BR>EMM International je vďaka 100% využitiu vlastných ľudských zdrojov a technických kapacít jednou z najskúsenejších firiem v&nbsp;danej oblasti.<BR></P>');
INSERT INTO page_properties VALUES (488, 11, 'body', '<H2>Poplachový systém na hlásenie narušenia (PSN)</H2>
INSERT INTO page_properties VALUES (494, 23, 'body', '<H2>Zásady pre posielanie požiadaviek na podporu a servis:</H2>
INSERT INTO page_properties VALUES (495, 22, 'body', '<P>Spoločnosť EMM International je dlhodobo zapísaná v povedomí zákazníkov aj ako spoločnosť, poskytujúca kvalitné servisné služby. Servis vykonávajú certifikovaní pracovníci, ktorí sú pravidelne školení na najnovšie technológie kľúčových partnerov. Servis sa vykonáva na území celého Slovenska. Pracovníci úseku technickej podpory sú k dispozícii počas bežnej pracovnej doby, ktorá je v čase 07:30 - 16:00.</P>
INSERT INTO page_properties VALUES (511, 116, 'body', '<P>V tejto časti už onedlho nájdete podrobné manuály nami ponúkaných produktov. Pokiaľ súrne potrebujete manuál k u nás zakúpenému tovaru, prosím kontaktujte nás na adrese: <A href="mailto:support@inter.emm.sk">support@inter.emm.sk</A>&nbsp; </P>');
INSERT INTO page_properties VALUES (512, 18, 'body', '<P>Spoločnosť EMM International spol s r.o. sa špecializuje na predaj a dodávku komponentov a komplexných riešení v rôznych oblastiach. Ponúkame široký sortiment špičkových produktov od renomovaných svetových výrobcov, ktorý používajú pri výrobe svojich výrobkov najnovšie technológie a taktiež&nbsp;sú držiteľmi rôznych certifikátov kvality ISO.&nbsp;Ponúkané komponenty môžete nájsť&nbsp;v našom&nbsp;elektronickom obchode&nbsp;v sekcii&nbsp; "<SPAN style="FONT-SIZE: 1.2em"><A href="http://inter.emm.sk/index.php?module=pageContent&amp;pageId=67&amp;PHPSESSID=859r3s53mhnnd9mkigh2q52v90">E-obchod</A>".</SPAN></P>
