INSERT INTO catalogue_product VALUES (202, 55, 1, '2007-02-26 09:42:29.089591', NULL, 'GSM komunikátor VM3', '<P>VM3 je interfejs medzi analógovým telefonickým zariadením a GSM sieťou. Umožňuje prenos dát naprogramovaných zo zabezpečovacích ústrední, alebo z iného komunikačného zariadnia (napríklad: ID protokol, hlasové správy...). Môže byť použitý aj na hlasovú komunikáciu medzi dvoma užívateľmi ako aj zálohované (Back-Up) spojenie pre štandardnú PSTN telefónnu linku v prípade jej zlyhania. Aplikovať sa dá aj pre prípad úspornej komunikácie vo firmách pri volaniach na GSM z pevnej telefónnej linky. VM3 sa dá použiť v spojení s riadiacimi zabezpečovacími jednotkami, s automatickými hlasovými, digitálnymi alebo signálnymi telefonickými volačmi, so štandardnými telefonickými súpravami, alebo s PABX – privátnymi telefonnymi ústredňami.</P>
