INSERT INTO catalogue_product VALUES (319, 114, 1, '2007-03-26 13:32:07.74011', NULL, 'Programátor OH/SW', '<P>PROGRAMÁTOR -&nbsp; slúži na naprogramovanie a nastavenie parametrov, ktorým sa systém prispôsobí potrebám zákazníka. Umožňuje úpravu grafického rozhrania OH/T terminálov.</P>
INSERT INTO catalogue_product VALUES (206, 114, 1, '2007-02-26 11:06:00.991563', NULL, 'Ovládací panel OH/T.01', '<P>OVLÁDACÍ PANEL S DOTYKOVÝM DISPLAYOM - napájaný po zbernice z OH/A modulu. Spolu s OH/A tvorí základ systému HOASIS. Slúži ako rozhranie medzi užívateľom a systémom. Obsahuje funkciu termostatu, umožňuje kontrolu a nastavenie ostatných termostatov v systéme ako aj ovládanie osvetlenia, žalúzií, všetkých pripojených automatizovaných zón a tiež umožňuje ovládanie vopred vytvorených, užívateľom zadefinovaných scenárov (makier).</P>
INSERT INTO catalogue_product VALUES (205, 114, 1, '2007-02-26 11:04:16.109219', NULL, 'Napájací zdroj OH/A.01', '<P>NAPÁJACÍ ZDROJ 230V 50/60HZ - pre napájanie HOASIS modulov zapojených na spoločnej dátovej zbernici. Zaberie priestor&nbsp;6 modulov na DIN lište. Možnosť zálohovania napájania z nezávislého zdroja (24Vac/Vdc 10VA). Spolu s modulom OH/T trvorí základ kažého systému HOASIS Plus.</P>
INSERT INTO catalogue_product VALUES (321, 114, 1, '2007-03-26 13:37:58.279598', NULL, 'Regulačný modul NH/DIM', '<P>REGULAČNÝ DIM MODUL - 1 relé s výstupným napätím 1-10V DC, ktorým sa dajú regulovať jednotlivé vstupy na svietidlách, pri použití vhodných výkonových modulov. Prevedenie aj na DIN lištu, zaberie miesto 1 DIN modulu.&nbsp; </P>
INSERT INTO catalogue_product VALUES (212, 114, 1, '2007-02-26 11:16:00.90848', NULL, 'Reléový modul OH/2RP', '<P>EXPANZNÝ MODUL. 2-RELÉ - použiteľný výlučne s OH/RP, slúži na rozšírenie modulu OH/RP o 2 nezávislé relé. K modulu OH/RP sa pripája systémovým flat káblom. Zaťažiteľnosť relé výstupov je 16A.</P>
INSERT INTO catalogue_product VALUES (214, 114, 1, '2007-02-26 11:20:42.295976', NULL, 'Reléový modul OH/3RPI', '<P>3 VSTUPY - 3 RELÉ (16A) - prevedenie na DIN lištu, zaberie miesto 1 modulu. Obsahuje 3 vstupy a 3 releové výstupy pre obládanie domácich automatizovaných zón.</P>
INSERT INTO catalogue_product VALUES (209, 114, 1, '2007-02-26 11:11:14.731074', NULL, 'Vstupný modul OH/6I', '<P>6 VSTUPOVÝ MODUL - prevedenie aj na DIN lištu, zaberie miesto 1modulu. Modul je možné umiestniť aj do inštalačnej škatule KO68. Obsahuje 6 vstupov pre ovládanie domácich automatizovaných zón - zariadení prostredníctvom senzorov alebo spínačov, vypínačov pripojených k vstupom.</P>
INSERT INTO catalogue_product VALUES (213, 114, 1, '2007-02-26 11:19:02.743036', NULL, 'Zalúziový modul OH/MA', '<P>AUTOMATIZAČNÝ MODUL (16A) - prevedenie aj na DIN lištu. Modul OH/MA je určený na ovládanie elektrických pohonov vonkajších a vnútorných žalúzií, markíz, brán a podobne. Napájanie po spoločnej zbernici. Obsahuje 3 vstupy a 3 výstupy. Upozornenie: vstupy na tomto module je možné použiť len pre ovládanie jeho vlastných výstupov.</P>
INSERT INTO catalogue_product VALUES (210, 114, 1, '2007-02-26 11:13:00.433437', NULL, 'Reléový modul OH/RI', '<P>MODUL S 3 VSTUPMI, 1 VÝSTUPOM - prevedenie aj na DIN lištu, zaberie miesto 1 modulu. Modul je možné umiestniť aj do inštalačnej škatule KO68. Obsahuje 3 vstupy a 1 reléový výstup (10A) pre ovládanie domácich automatizovaných zón - zariadení. </P>
INSERT INTO catalogue_product VALUES (211, 114, 1, '2007-02-26 11:14:26.872816', NULL, 'Reléový modul OH/RP', '<P>1 VÝKONOVÝ VÝSTUP - releový modul s jedným relé pre spínamie maximálnej odporovej záťaže 16A. Možnosť osadenia na DIN lištu, zaberie miesto 1 modulu. Modul je možné umiestniť aj do inštalačnej škatule KO68.&nbsp;</P>
INSERT INTO catalogue_product VALUES (208, 114, 1, '2007-02-26 11:09:48.502211', NULL, 'Releový modul OH/R.01', '<P>RELEOVÝ MODUL - napájanie priamo zo zbernice veľkosť 6 DIN, nízky profil. Počet vstupov 4. Počet releových výstupov 4 s max. záťažou 5A (2A idukčná záťaž). Relé nie sú vhodné pre NEÓNOVÉ lampy s príkonom väčším ako 40W.</P>
INSERT INTO catalogue_product VALUES (318, 114, 1, '2007-03-23 14:43:34.049736', NULL, 'Termostatový modul OH/Z.02BB', '<P align=left>TERMOSTATOVÝ MODUL - týždenný digitálny programovateľný termostat, s nastavením troch referenčných teplôt. Termostat je napájaný cez zbernicu a môže zapínať napr. plynový kotol, elekrtický ventil, podlahové kúrenie v miestnosti prostredníctvom&nbsp; ktorékoľvek relé, ktoré je zapojené v systéme. Max. počet OH/Z modulov v jednom systéme je 7.</P>
