INSERT INTO catalogue_product VALUES (201, 55, 1, '2007-02-26 09:40:32.61136', NULL, 'GSM komunikátor PKN4 Plus', '<P>PKN4 PLUS-GSM je nový typ mobilnej hlasovej a SMS komunikácie. Pamäť telefónu, vo forme SIM karty, je využitá pre uchovanie telefónnych čísel a programu, vrátane všetkých parametrov. Je možné zaznamenať štyri rôzne správy a&nbsp;poslať ich až na desať rôznych telefónnych čísel. Alarmové vstupy môžu byť normal open (N.O.) a&nbsp;teda na ich výstupe sa objaví kladné napätie (+12V) alebo záporný impulz (GND); alebo budú normal close (stratí sa +12V alebo GND). Každý alarmový vstup je schopný poslať predtým zaznamenanú hlasovú správu, alebo SMS, či oboje. PKN4 má tiež štyri výstupy, dávajúce užívateľovi možnosť ovládať systém diaľkovo pomocou DTMF, SMS alebo CLIP príkazov.</P>
