<P><SPAN class=nad_blue>Technická a objektová bezpečnosť</SPAN></P>
</H2>
<P>Technická bezpečnosť predstavuje veľmi citlivú oblasť na kvalitu a spoľahlivosť komponentov. Akákoľvek súčasť našich riešení predstavuje technologickú špičku a s úspechom sa podrobila náročným testom. Komponenty&nbsp;distribuované našou spoločnosťou spĺňajú prísne kritériá európskych noriem ISO. Tieto normy sú celosvetovo považované za nepísaný zákon hlavne vo finančných a obchodných organizáciách.<BR><BR>Našimi najvýznamnejšími partnermi, s ktorými dlhodobo a úspešne spolupracujeme pri dodávkach komponentov technickej bezpečnosti sú:<BR><BR><I>eff-eff</I> - spoločnosť dlhoročne pôsobiaca na európskych trhoch, predstavujúca absolútnu svetovú špičku v oblasti technickej bezpečnosti, ktorá je nositeľom certifikátu akosti kvality DIN ISO 9001, DIN ISO 9002.</P>
<P>bpt - talianska spoločnosť pôsobiaca v oblasti audio a video vstupných systémov, ale aj v oblasti automatizovaných domových systémov a oblasti programovateľných termostatov, ktorá pôsobí na trhu už viac ako 50 rokov. Spoločnosť je nositeľom certifikátu&nbsp;&nbsp;<FONT size=2>ISO 9001 a ISO 14001.</FONT></P>
