<P>Základný úžitok a benefit</P>
<P>Dochádzkový systém slúži na evidenciu dochádzky zamestnancov v organizácii podľa prechodov zaznačených na čítacích jednotkách. Dochádzkový systém zabezpečuje okrem výpočtu odpracovanej doby automatické generovanie príplatkov, vyhodnocuje rôzne druhy prerušenia pracovnej doby, podáva informáciu o prítomných zamestnancoch a generuje údaje pre automatický prevod do programového vybavenia Platy a mzdy.</P>
<P>Široký sortiment, spoľahlivosť a kvalita prvkov DS umožňuje jeho aplikovanie vo všetkých typoch organizácií, od štátnej správy cez bankové inštitúcie až po výrobné organizácie. Použitie DS umožňuje zrýchliť a spresniť analytické a rozhodovacie procesy a zároveň znižuje chybovosť a prácnosť pri ručnom spracovaní dochádzky.</P>
<H2>Štruktúra a architektúra</H2>
<P>Základným prvkom DS sú čítacie jednotky. Na čítacích jednotkách si zamestnanci pri príchode a odchode značia pomocou bezkontaktných identifikačných kariet prechod. Tieto informácie sa podľa voliteľne nastaveného intervalu z čítacích jednotiek vyčítajú&nbsp; a odovzdajú programovému vybaveniu DS na spracovanie. Programové vybavenie DS tieto údaje podľa nadefinovaných pravidiel spracuje. Do programu DS je umožnený vstup tzv. spracovateľov. Ich úlohou je kontrolovať správnosť údajov, prípadne doplniť chýbajúce údaje. Výstup z DS po mesačnej uzávierke je podkladom pre výpočet miezd.</P>
<P>Prístup do programu je chránený heslom, pričom pri prihlásení sa zistí aj úroveň spracovateľa. Úrovne prístupu spracovateľov do programového vybavenia DS sú rôzne podľa úloh a právomocí spracovateľa. Programové vybavenie je dodávané v sieťovej alebo nesieťovej verzii. V prípade sieťovej verzie sú údaje o dochádzke nainštalované na SQL serveri a môžu k nim pristupovať všetci používatelia, ktorí sú k tomu oprávnení.</P>
<H2>Vlastnosti</H2>
<P>Dochádzkový systém Kriváň, Attend je vyvíjaný a vyrábaný v Slovenskej Republike. Táto skutočnosť zabezpečuje radu výhod od prispôsobenia sa požiadavkám slovenského trhu až po rýchlu odozvu na nadštandardné úpravy či už programového alebo&nbsp;&nbsp; technického vybavenia.</P>
<P>Dochádzkový systém je flexibilný a je ho použitie je možné v rôznych oblastiach od malých spoločností až po veľké organizácie.</P>
<P>Identifikácia užívateľov je zabezpečená bezkontaktnou identifikačnou kartou. Prednosti použitia týchto kariet spočívajú v dlhej životnosti (záruka je obmedzená životnosťou systému) a vysokej odolnosti voči poškodeniu. Tieto karty je zároveň možné potlačiť a používať aj ako zamestnanecký preukaz.</P>
<H2>Komunikácia</H2>
<P>DS komunikuje s čítacími jednotkami cez rozhranie RS232/RS485. Dalšia možnosť komunikácie medzi riadiacim PC a čítacími jednotkami je cez TCP/IP protokol alebo použitím ďalšieho - takzvaného komunikačného PC. Spracovatelia spracovávajú údaje uložené na servri ako klienti zo svojho PC. V prípade nesieťovej verzie spracovatelia spracovávajú údaje priamo na servri.&nbsp;&nbsp; Dochádzkový systém je možné prepojiť so systémom SAP R3.</P>
<H2>Tvorba, nasadenie a možnosti rozširovania</H2>
<P>DS sa nasadzuje do objektov za účelom zrýchlenia a spresnenia evidencie dochádzky zamestnancov. Programové vybavenie je dodávané v dvoch základných verziách. Prvá verzia dochádzkového systému s názvom Attend znamená DOS aplikáciu. Toto programové vybavenie je naprogramované v prostredí FoxPro 2.6, ktoré je nenáročné na prevádzkovanie a pracuje v počítačových sieťach typu Windows, Novell a SCO Unix (terminálový režim). Druhá generácia dochádzkového systému je označovaná ako Kriváň (aplikácia Windows, klient/server). Dochádzkový systém Kriváň je moderné programové vybavenie programované v prostredí PowerBuilder 5.0, C++ a zrealizované výpočtovým modelom klient/server. Obe verzie programového vybavenia je možné rozšíriť o prevodový mostík do miezd. Windows verziu DS Kriváň je možné obojstranne prepojiť so systémom SAP R3.</P>
