<H2><SPAN class=nad_blue>EMM International</SPAN></H2>
<P>Systémy navrhované, konfigurované a realizované tímom odborníkov z EMM International sú na vysokej odbornej úrovni s garanciou kvality. Na jednom mieste nájdete všetko, čo potrebujete vedieť o jednotlivých komponentoch, ktoré&nbsp;plánujete použiť&nbsp;vo vašich projektoch. Výhodou vzájomnej spolupráce je možnosť návrhu systému podľa vašich požiadaviek. Vybudovanie komplexného&nbsp; systému máte s nami na dosah ruky.</P>
<P>Spoločnosť EMM International je držiteľom celtifikátu akosti kvality ISO 9001.</P>
<P>V spoločnosti <EM>EMM International spol s r.o. </EM>pôsobia nasledovné oddelenia:</P>
<UL>
    <LI>Obchodné oddelenie
    <LI>Technické oddelenie
    <LI>Úsek riadenia projektov
    <LI>Projekcia
    <LI>Realizačné oddelenie </LI>
</UL>
<P>Spoločnosť EMM International spol. s r.o. sa Vám predstavuje svojou históriou, vývojom a ponukou služieb a špičkových produktou v oblasti rôznych bezpečnostných, požiarnych, prístupových, kamerových, vstupných&nbsp;systémov. Korene spoločnosti siahajú až do roku 1991, odkedy sa dynamickým vývojom vyprofilovala na spoločnosť, ktorá realizuje projekty a dodávky zákazníkom na kľúč.</P>
<P>Našou hlavnou oblasťou, v ktorej máme dlhodobé skúsenosti a o ktorú by sme sa s Vami radi podelili, je distibúcia a predaj rôznych komponentov pre bezpečnostné systémy, požiarne systémy, prístupové systémy, systémy kontroly pochádzky a vstupu, systémy audio/video vrátnikov, systémy priemyselnej televízie a podobne. V týchto oblastiach poskytujeme komplexné služby, t.j. projektovanie, dodávku, montáž, revíziu, záručný a pozáručný servis,&nbsp;konzultačné a poradenské služby. Ak sa Vám vyskytne nejaká chyba po skončení našej pracovnej doby alebo cez víkend, je tu náš 7- dňový 24 hodinový servis. Dodávame komponenty, ktoré sú na svetovej technickej úrovni a&nbsp;sú od výrobcov, ktorý spĺňajú ISO&nbsp;normy o zhode. Taktiež predávame elektroinštalačný materiál prislúchajúci k ponúkaným systémom.</P>');
