<P>Vo svojej úspešnej činnosti sa opiera o erudovaných servisných pracovníkov poskytujúcich značkový servis ku všetkým dodávaným produktom.</P>
<P>EMM International sa orientuje vo svojej činnosti priamo na výrobcov ponúkaných zariadení. Dôvodom je nielen cenová prístupnosť,&nbsp; ale hlavne plynulosť a rýchlosť dodávok.</P>
<P>Spoločnosť EMM International, s.r.o. dlhodobo zabezpečuje elektronickú ochranu majetku zákazníkov realizáciou systémov vysokej kvalitatívnej úrovne.&nbsp;Štruktúra obchodných zástupcov pokrýva celé územie Slovenska,&nbsp;k čomu prispievajú aj pracoviská v Košiciach a vo Zvolene.&nbsp;</P>
<P>EMM International poskytuje svojim zákazníkom produkty, ktoré sú realizované najnovšími a najmodernejšími technológiami na svetovom trhu.</P>');
<P>Systém kontroly vstupov zabezpečuje prístup osôb do chráneného priestoru podľa voliteľne nadefinovaných pravidiel na základe identifikácie užívatelov. Systém SKV okrem chránenia priestoru pred neoprávneným vstupom poskytuje informácie o jednotlivých udalostiach, ktoré čítacia jednotka zaznamenala (otvorenie dverí kľúčom, otvorenie krytu čítacej jednotky, nepovolená karta a ďalšie systémové správy).</P>
<P>Široký sortiment, spoľahlivosť a kvalita prvkov SKV umožňuje ich aplikovanie na miestach s veľmi vysokými nárokmi na bezpečnosť, ako aj v priemyselných prevádzkach či súkromných objektoch. Použitie SKV zaručuje zvýšenie ochrany osôb a majetku spoločností ako aj súkromných osôb.</P>
<H2>Štruktúra a architektúra</H2>
<P>Základným prvkom SKV sú čítacie jednotky. Čítacie jednotky na základe nadefinovaných pravidiel rozhodujú o sprístupnení/nesprístupnení chráneného priestoru pre osobu, ktorá sa identifikovala na tomto zariadení identifikačným zariadením - bezkontaktnou identifikačnou kartou. Čítacie jednotky pracujú v troch základných režimoch:</P>
<UL>
    <LI>on-line - čítacie jednotky sú pripojené na riadiace PC vybavené softvérom prístupového systému,
    <LI>off_line - čítacie jednotky sú autonómne, pracujú samostatne bez potreby použitia riadiaceho PC,
    <LI>on-line/offline - čítacie jednotky sú pripojené na riadiace PC vybavené softvérom prístupového systému a v prípade výpadku komunikácie s riadiacim PC sa správajú ako autonómne podľa naposledy zadaných vstupných informácií. </LI>
</UL>
<P>Podľa potreby výšky úrovne bezpečnosti je v ponuke široká škála čítacích jednotiek od autonómnych s jednou čítacou hlavou bez klávesnice až po plne programovateľné čítacie jednotky s dvoma čítacími hlavami, klávesnicou na zadávanie PIN kódu az po čítaciu jednotku na odtlačok prsta. Čítaciu jednotku na odtlačok prsta je možné nastaviť na niekoľko režimov funkčnosti:</P>
<UL>
    <LI>čítanie len odtlačku prsta,
    <LI>čítanie odtlačku prsta a použitie osobného kódu,
    <LI>čítanie odtlačku karty a bezkontaktnej karty MIFARE na ktorej je odtlačok prsta uložený. </LI>
</UL>
<P>Pre zlepšenie kontroly monitorovania a riadenia SKV je možné použiť programové vybavenie Prístupový systém WIS. Prístupový systém WIS zabezpečuje okrem riadenia samotného SKV aj jeho prepojenie s ďalšími systémami.</P>
<H2>Vlastnosti</H2>
<P>Systém kontroly vstupov WIS je vyvíjaný a vyrábaný v Slovenskej Republike. Táto skutočnosť zabezpečuje radu výhod od prispôsobenia sa požiadavkám slovenského trhu až po rýchlu odozvu na nadštandardné úpravy či už programového alebo&nbsp; &nbsp;technického vybavenia.</P>
<P>Programové vybavenie WIS umožňuje prepojenie a spoluprácu SKV ako celku so systémami ako sú PSN (Poplachový systém na hlásenie narušenia), EPS (Elektrická požiarna signalizácia) PTV (systém priemyselnej televízie) alebo systém CMS (centrálny monitorovací systém).</P>
<P>Systém kontroly vstupov je flexibilný a jeho použitie je možné v rôznych oblastiach od malých spoločností až po veľké organizácie.</P>
<P>Identifikácia užívateľov je zabezpečená bezkontaktnou identifikačnou kartou. Prednosti použitia týchto kariet spočívajú v dlhej životnosti (záruka je obmedzená životnosťou systému) a vysokej odolnosti voči poškodeniu. Tieto karty je zároveň možné potlačiť a používať aj ako zamestnanecký preukaz. Bezkontaktné identifikačné karty, využívané v systéme SKV je možné využiť aj v ďalších nadstavbových aplikáciách, napríklad:</P>
<UL>
    <LI>dochádzkový systém
    <LI>stravovací systém
    <LI>návštevný systém
    <LI>parkovací systém </LI>
</UL>
<P>a v ďalších bezpečnostných systémoch využívajúcich identifikačné médium.</P>
<H2>Komunikácia</H2>
<P>SKV riadený z riadiaceho PC pomocou programového vybavenia komunikuje s čítacími jednotkami cez rozhranie RS232/RS485. Dalšia možnosť komunikácie medzi riadiacim PC a čítacími jednotkami prebieha cez TCP/IP protokol alebo použitím ďalšieho - takzvaného komunikačného PC.</P>
<P>Čítacie jednotky pracujúce v autonómnom režime je možné programovať pomocou tzv. Master karty.</P>
<P>Tvorba, nasadenie a možnosti rozširovania</P>
<P>Systém SKV sa nasadzuje do objektov, kde je potrebné kontrolovať, sledovať a evidovať pohyb osôb. Neoddeliteľnou súčasťou technického vybavenia SKV sú mechanické zábrany, medzi ktoré patria elektromagneticky ovládané turnikety, mechanické vstupné systémy a zábrany, automatické pohony brán a závor. Programové vybavenie je v dvoch základných verziách.&nbsp;&nbsp; Prvá verzia je WIS/D čo znamená (DOS aplikáciu). Druhá je označovaná ako WIS/K (aplikácia Windows, klient/server).</P>
<P>Obe verzie programového vybavenia je možné rozšíriť o niekoľko nadstavbových modulov. Medzi nadstavbové moduly, o ktoré je možné rozšíriť SKV, patria:</P>
<UL>
    <LI>Dochádzkový systém
    <LI>Stravovací systém
    <LI>Návštevný systém
    <LI>Obchôdzkový systém </LI>
</UL>');
<P>Dochádzkový systém slúži na evidenciu dochádzky zamestnancov v organizácii podľa prechodov zaznačených na čítacích jednotkách. Dochádzkový systém zabezpečuje okrem výpočtu odpracovanej doby automatické generovanie príplatkov, vyhodnocuje rôzne druhy prerušenia pracovnej doby, podáva informáciu o prítomných zamestnancoch a generuje údaje pre automatický prevod do programového vybavenia Platy a mzdy.</P>
<P>Široký sortiment, spoľahlivosť a kvalita prvkov DS umožňuje jeho aplikovanie vo všetkých typoch organizácií, od štátnej správy cez bankové inštitúcie až po výrobné organizácie. Použitie DS umožňuje zrýchliť a spresniť analytické a rozhodovacie procesy a zároveň znižuje chybovosť a prácnosť pri ručnom spracovaní dochádzky.</P>
<H2>Štruktúra a architektúra</H2>
<P>Základným prvkom DS sú čítacie jednotky. Na čítacích jednotkách si zamestnanci pri príchode a odchode značia pomocou bezkontaktných identifikačných kariet prechod. Tieto informácie sa podľa voliteľne nastaveného intervalu z čítacích jednotiek vyčítajú&nbsp; a odovzdajú programovému vybaveniu DS na spracovanie. Programové vybavenie DS tieto údaje podľa nadefinovaných pravidiel spracuje. Do programu DS je umožnený vstup tzv. spracovateľov. Ich úlohou je kontrolovať správnosť údajov, prípadne doplniť chýbajúce údaje. Výstup z DS po mesačnej uzávierke je podkladom pre výpočet miezd.</P>
<P>Prístup do programu je chránený heslom, pričom pri prihlásení sa zistí aj úroveň spracovateľa. Úrovne prístupu spracovateľov do programového vybavenia DS sú rôzne podľa úloh a právomocí spracovateľa. Programové vybavenie je dodávané v sieťovej alebo nesieťovej verzii. V prípade sieťovej verzie sú údaje o dochádzke nainštalované na SQL serveri a môžu k nim pristupovať všetci používatelia, ktorí sú k tomu oprávnení.</P>
<H2>Vlastnosti</H2>
<P>Dochádzkový systém Kriváň, Attend je vyvíjaný a vyrábaný v Slovenskej Republike. Táto skutočnosť zabezpečuje radu výhod od prispôsobenia sa požiadavkám slovenského trhu až po rýchlu odozvu na nadštandardné úpravy či už programového alebo&nbsp;&nbsp; technického vybavenia.</P>
<P>Dochádzkový systém je flexibilný a je ho použitie je možné v rôznych oblastiach od malých spoločností až po veľké organizácie.</P>
<P>Identifikácia užívateľov je zabezpečená bezkontaktnou identifikačnou kartou. Prednosti použitia týchto kariet spočívajú v dlhej životnosti (záruka je obmedzená životnosťou systému) a vysokej odolnosti voči poškodeniu. Tieto karty je zároveň možné potlačiť a používať aj ako zamestnanecký preukaz.</P>
<H2>Komunikácia</H2>
<P>DS komunikuje s čítacími jednotkami cez rozhranie RS232/RS485. Dalšia možnosť komunikácie medzi riadiacim PC a čítacími jednotkami je cez TCP/IP protokol alebo použitím ďalšieho - takzvaného komunikačného PC. Spracovatelia spracovávajú údaje uložené na servri ako klienti zo svojho PC. V prípade nesieťovej verzie spracovatelia spracovávajú údaje priamo na servri.&nbsp;&nbsp; Dochádzkový systém je možné prepojiť so systémom SAP R3.</P>
<H2>Tvorba, nasadenie a možnosti rozširovania</H2>
<P>DS sa nasadzuje do objektov za účelom zrýchlenia a spresnenia evidencie dochádzky zamestnancov. Programové vybavenie je dodávané v dvoch základných verziách. Prvá verzia dochádzkového systému s názvom Attend znamená DOS aplikáciu. Toto programové vybavenie je naprogramované v prostredí FoxPro 2.6, ktoré je nenáročné na prevádzkovanie a pracuje v počítačových sieťach typu Windows, Novell a SCO Unix (terminálový režim). Druhá generácia dochádzkového systému je označovaná ako Kriváň (aplikácia Windows, klient/server). Dochádzkový systém Kriváň je moderné programové vybavenie programované v prostredí PowerBuilder 5.0, C++ a zrealizované výpočtovým modelom klient/server. Obe verzie programového vybavenia je možné rozšíriť o prevodový mostík do miezd. Windows verziu DS Kriváň je možné obojstranne prepojiť so systémom SAP R3</P>');
