<P>Po vzniku poplachu z kamery alebo zo snímača je možné zaznamenávať videosekvenciu. Poplach je možné sledovať na vzdialenej pracovnej stanici v počítačovej sieti (eternet, internet). Môže byť prostredníctvom doplnkových zariadení napojený na ľubovoľný ďalší zabezpečovací alebo poplašný systém.</P>
<H2>Komunikácia</H2>
<P>Prenos údajov z kamery na monitor sa realizuje niekoľkými spôsobmi. Prvý spôsob prenosu údajov môže byť realizovaný prostredníctvom koaxiálneho kábla. Druhý spôsob prenosu údajov je možné realizovať s využitím počítačovej siete. Prenos obrazu môže byť taktiež realizovaný prostredníctvom rádiového prenosu. Systém priemyselnej televízie je možné prepojiť so systémom Elektrickej požiarnej signalizácie, Poplachovým Systémom na hlásenie Narušenia (PSN), Systémom Kontroly Vstupov (SKV)&nbsp;alebo Centrálnym monitorovacím systémom (CMS).</P>
<H2>Tvorba, nasadenie a možnosti rozširovania</H2>
<P>Systém priemyselnej televízie sa nasadzuje do objektov za účelom monitorovania dôležitých priestorov. Systémy PTV je možné kedykoľvek rozšíriť podľa požiadaviek užívateľa.</P>');
