<P><SPAN style="FONT-SIZE: 9pt; FONT-FAMILY: Arial">Pri mimoriadnych situáciách je človek často odkázaný na podporu a je vďačný za detailné informácie, ktoré mu napomáhajú lepšie posúdiť situáciu. V oblasti bezpečnostného managementu je táto potreba pochopiteľne ešte silnejšia.</SPAN></P>
<P><SPAN style="FONT-SIZE: 9pt; FONT-FAMILY: Arial">Medzi ľudskými zmyslami majú oči výnimočný význam. Je nimi možné počas krátkeho okamihu prijať a spracovať veľmi veľké množstvo informácií.</SPAN></P>
<P><SPAN style="FONT-SIZE: 9pt; FONT-FAMILY: Arial">V dôsledku tejto skutočnosti je jasné, že v citlivej oblasti bezpečnostného managementu existuje prianie, vizuálne sprostredkovať na jednom mieste, zriadenom pre tento účel, aktuálne informácie o stave relevantných častí zariadení.</SPAN></P>
<P><SPAN style="FONT-SIZE: 9pt; FONT-FAMILY: Arial">Spoločnosť effeff vyvinula na báze prepojenia jednotlivých súčastí bezpečnostného systému Integrovaný bezpečnostný informačný systém WINMAG.</SPAN></P>
<P class=MsoNormal style="MARGIN: 0in 0in 0pt"><SPAN lang=SK style="FONT-SIZE: 9pt; FONT-FAMILY: Arial">&nbsp;</SPAN></P>
<H2 style="MARGIN: auto 0in"><SPAN style="FONT-FAMILY: Arial">Dispečerský centrálny monitorovací systém CMS</SPAN></H2>
<SPAN lang=SK style="FONT-SIZE: 9pt; FONT-FAMILY: Arial; mso-fareast-font-family: ''Times New Roman''; mso-ansi-language: SK; mso-fareast-language: CS; mso-bidi-language: AR-SA">Dispečerský monitorovací systém CMS je určený na nepretržité sledovanie stavu lokálnych zabezpečovacích a ochranných subsystémov vzdialených objektov a riadenie činnosti dispečerov pri vzniku mimoriadnych udalostí. Základom systému je sieť vysielačov a prijímačov systému CMS s diaľkovými prenosmi údajov</SPAN>');
<P align=left>Komunikačné audio/video systémy, alebo tiež vstupné audio/video&nbsp;sytémy pozostávajú z troch hlavných častí. </P>
<P align=left>Prvou častou sú vstupné tablá alebo panely, ktoré sú najčastejšie umiestnené pri vstupných dverách. Tieto môžu byť audio, alebo video a môžu byť v rôznom farebnom či konštrukčnom prevedení - štandardné, antivandal, alebo historické. Súčasťou vstupných panelov sú tlačidlá na vyzvonenie užívateľa (spojenie sa s užívateľom). Môžu to byť klasické analógové tlačidlá, alebo to môže byť digitálna kódová klávesnica pomocou ktorej sa zvolí požadovaný užívateľ. </P>
<P align=left>Druhou časťou systému sú prijímače (telefóny) umiestnené u koncového užívateľa. Pomocou prijímača komunikuje užívateľ s osobou, ktorá je pri vstupnom paneli a vyzvonila daného užívateľa. Aj tieto prijímače môžu byť audio, alebo video. Užívateľ má na výber z nasledovných druhov prijímačov: </P>
<UL>
    <LI>LYNEA
    <LI>EXEDRA
    <LI>NOVA
    <LI>OPHERA </LI>
</UL>
<P align=center><IMG height=163 src="/pics/upload/users/admin/Image/banner_bpt1.png" width=506 align=middle></P>
<P>Treťou časťou systému sú riadiace a napájacie jednotky, rôzne distribútori, blokové selektory, zosilňovače a reléové jednotky, ktoré sú umiestnené v rozvodovej skrini. Tieto jednotky slúžia na riadenie a napájanie celého systému.</P>
<P>Vstupné audio/video telefóny dokážu pracovať vo viacerých systémoch. Tieto systémy sa volia podľa zložitosti a náročnosti danej aplikácie nakoľko systémy od spoločnosti Bpt môžu byť použité v rôzne veľkých objektoch od rodinných domov až po obrovské obytné súbory. Rozdelenie systémov je nasledovné: </P>
<UL>
    <LI>Systém 200
    <LI>Systém 300
    <LI>Systém X1
    <LI>Systém X2
    <LI>Systém Xup </LI>
</UL>');
<P>Systém priemyselnej televízie slúži na monitorovanie dôležitých priestorov. Použitie PTV na základe obrazovej informácie zároveň umožňuje zrýchliť a spresniť analytické a rozhodovacie procesy. Systém PTV môže byť použitý aj ako doplnok systémov PSN (Poplachový systém na hlásenie narušenia), EPS (Elektrická požiarna signalizácia), SKV (Systém kontroly vstupov) alebo CMS (Centrálny monitorovací systém). Komponenty Systému priemyselnej televízie ponúkame od niekoľkých svetových výrobcov.&nbsp;Táto skutočnosť zaručuje dostatočne široký sortiment komponentov začínajúci od klasických priemyselných kamier cez Web kamery&nbsp;až po digitálne záznamníky a mnoho dalšieho príslušenstva ako napríklad špeciálne kryty do&nbsp;rôzneho prostredia.</P>
