<P><IMG style="WIDTH: 680px; HEIGHT: 155px" height=155 hspace=20 src="/pics/upload/users/admin/Image/sunell.JPG" width=680></P>
<H2>Štruktúra a architektúra</H2>
<P>Základnými prvkami PTV sú kamery a monitory. Takéto zloženie však umožňuje iba on-line sledovanie záberov z kamier.&nbsp; Vzhľadom&nbsp; k&nbsp; tejto skutočnosti sa systémy PTV rozširujú o&nbsp;záznamové zariadenia.&nbsp;Záznamové zariadenia rozdeľujeme do dvoch základných skupín. Prvú skupinu tvoria STAND ALONE zázanamníky.&nbsp;Druhú skupinu tvoria PC BASE záznamníky. V takomto prípade sa&nbsp; záznam nahráva na HDD PC. Dĺžka nahrávania je pri oboch skupinách voliteľná v závislosti od potrieb zákazníka. Systémy PTV sa ďalej rozširujú o zariadenia ktoré umožňujú na jednom monitore sledovať viac kamier naraz. Sledovanie viacerých kamier na jednom monitore zabezpečujú quadrátory a multiplexory.</P>
<P align=center><STRONG>Rozdelenie záznamníkov:</STRONG></P>
<P><IMG height=130 hspace=60 src="/pics/upload/users/admin/Image/XRS.JPG" width=597></P>
<H2>Vlastnosti</H2>
<P>Systém priemyselnej televízie umožňuje získať prehľad o odľahlých miestach vybavených kamerami. Zároveň umožňuje získať informáciu o stave monitorovaného priestoru či už v reálnom čase alebo v minulosti na základe nahraných údajov. Užívateľovi tak umožní získať dôkazový materiál o situácii v sledovanom (monitorovanom) priestore. Systémy priemyselnej televízie v prípade&nbsp; použitia digitálneho záznamníka umožňujú nasnímané údaje posielať cez klasickú pocítačovú sieť na ľubovoľné PC pripojené v sieti.</P>
<P>Na jeden systém je možné pripojiť niekoľko kamier, ktoré sú prostredníctvom špeciálnej digitalizačnej karty pripojené k počítaču a obsluhované v reálnom čase.</P>
<P>Každá kamera môže byť zdrojom poplachu ako aktívny prvok, ktorý sa môže kombinovať s mechanickými, optickými, mikrovlnnými alebo inými snímačmi. K systémom na digitálne spracovanie obrazu je možné voliteľne pripojiť ďalšie snímače a pre každý je možné programovo nastaviť rozlíšenie hodnoty slučky pre poplach alebo sabotáž.</P>
<P>Po vzniku poplachu z kamery alebo zo snímača je možné zaznamenávať videosekvenciu. Poplach je možné sledovať na vzdialenej pracovnej stanici v počítačovej sieti (eternet, internet). Môže byť prostredníctvom doplnkových zariadení napojený na ľubovoľný ďalší zabezpečovací alebo poplašný systém.</P>
<H2>Komunikácia</H2>
<P>Prenos údajov z kamery na monitor sa realizuje niekoľkými spôsobmi. Prvý spôsob prenosu údajov môže byť realizovaný prostredníctvom koaxiálneho kábla. Druhý spôsob prenosu údajov je možné realizovať s využitím počítačovej siete. Prenos obrazu môže byť taktiež realizovaný prostredníctvom rádiového prenosu. Systém priemyselnej televízie je možné prepojiť so systémom Elektrickej požiarnej signalizácie, Poplachovým Systémom na hlásenie Narušenia (PSN), Systémom Kontroly Vstupov (SKV)&nbsp;alebo Centrálnym monitorovacím systémom (CMS).</P>
