<P class=nad_blue>Základný úžitok a benefit</P>
<P>Technológia protipožiarnej signalizácie je založená na spolupráci vysoko kvalitnej, procesorom riadenej ústredne a špičkových požiarnych hlásičov, ktoré dokážu odhaliť požiar už v jeho zárodku. Vďaka svojej vyspelej modulárnej technológii umožnuje ústredňa uspokojiť aj najnáročnejšie požiadavky zákazníka. Hardvérovo i softvérovo sa jednoducho prispôsobí požiadavkám každého riešenia.&nbsp;</P>
<P>&nbsp;</P>');
<P class=nad_blue align=left>Základný úžitok a benefit</P>
<P align=left>Nami ponúkané zariadenia poplachového systému na hlásenie narušenia (PSN) sú jedny z najmodernejších elektronických bezpečnostných systémov. Široký sortiment, spoľahlivosť a kvalita prvkov PSN z produkcie umožnuje ich aplikovanie na miestach s veľmi vysokými nárokmi na bezpečnosť, ako aj v priemyselných prevádzkach či súkromných objektoch. Ponúkame ústredne od viacerých svetových výrobcov.</P>
<P align=left>Rozsiahle možnosti programovania, funkčná variabilita, integrované skúšobné a diagnostické programy prinášajú komplexné riešenie pre každý objekt.&nbsp;&nbsp; </P>
