<P><STRONG>Motorest a pneuservis, Kováčová</STRONG><BR><STRONG>2 B-plus, s.r.o.</STRONG> <BR>Systém HOASIS+ ovláda osvetlenie v celej časti motorestu a tiež v časti servisu. Prostredníctvom HOASIS-u sa ovládajú preddefinované svetelné scény, vetranie a aj osvetlenie exteriéru.</P>
<P><STRONG>RD Bratislava, Karlova Ves</STRONG><BR><STRONG>EMM International, s.r.o.</STRONG> <BR>Systém HOASIS+ ovláda exteriérové žalúzie v celom rodinnom dome. Užívateľ ovláda žalúzie buď jednotlivo, alebo má možnosť pomocou vopred zadefinovaných scenárov ovládať žalúzie centrálne - naraz z dotykového panela. Systém HOASIS+ tiež ovláda žalúzie aj na základe informácií z meteo stanice. Pokiaľ rýchlosť vetra prekročí nastavenú hranicu, žalúzie sa vytiahnu, prípadne ak svieti ostré slnko, žalúzie sa zatiahnu.</P>
<P><STRONG>RD Bratislava, Devínska nová Ves</STRONG><BR><STRONG>Ľubor Dobšovič DOMOK</STRONG> <BR>Systém HOASIS+ ovláda v rodinnom dome osvetlenie, vykurovanie, žalúzie a aj hlavný ventil vody a plynu. Ovládanie svetelných obvodov je realizované prostredníctvom klasických vypínačov a tiež pomocou dvoch dotykových panelov. Rovnako je možné pomocou týchto panelov ovládať aj všetky žalúzie a vykurovania v celom dome. Teploty v obytných miestnostiach sa menia aj nezávisle prostredníctvom zónových termostatov, umiestnených v jednotlivých izbách. Vykurovanie je ovplyvňované aj magnetmi v oknách, pokiaľ je okno otvorené systém nekúri a to aj napriek tomu, že je požiadavka na kúrenie. Takýmto spôsobom sa predíde zbytočnému - neekonomickému vykurovaniu. Investor má možnosť ovládať jednotlivé technológie v domácnosti aj prostredníctvom zadefinovaných scenárov (osvetlenie, stmievanie, ovládanie osvetlenie na základe intenzity vonkajšieho osvetlenia, centrálne ovládanie teplôt, žalúzií)</P>');
<P>Digitálne záznamníky STAND-ALONE:&nbsp; <A href="http://www.interemm.szm.sk/DVR-STANDALONE.pdf" target=_blank>PDF</A></P>');
<H4 align=center><IMG height=209 src="/pics/upload/users/admin/Image/ophera_vanil1.png" width=260></H4>
<H5>Prevedenie </H5>
<P>V prípade použitia OPHERA telefónov v obytných komplexoch s recepčnou úst</P>
<P align=right><IMG height=215 src="https://netadmin.inter.emm.sk/pics/upload/users/admin/Image/ophera_orange1.png" width=260 align=right></P>
<P>redňou, majú 2 tlačidlá funkciu „volanie recepcie“ a „panik“. Tiesňové tlačidlo má absolútnu prioritu signalizácie na recepcii, kde sa na ústredni zobrazí číslo bytu odkiaľ je volané. </P>
<H5>Príslušenstvo pre vnútornú komunikáciu - interkom</H5>
<P>Všetky OPHERA telefóny&nbsp;sú vybavené 5-tlačidlovým modulom (súčasť balenia), pre volanie až 8 vnútorných jednotiek (4 vyzváňacie tlačidlá + 1 prepínacie) </P>
<H5>Rôznofarebné kryty </H5>
<P>Súčasťou balenia sú aj vymeniteľné dvojice postranných krytov v 3 </P>
<P align=right><IMG height=212 src="https://netadmin.inter.emm.sk/pics/upload/users/admin/Image/ophera_blue1.png" width=260 align=right></P>
<P>farbách: oranžová, polárna modrá a vanilka </P>
<H5>Montážne krabice </H5>
<P>Špeciálne krabice pre zapustenú montáž videotelefónu OPHERA sú priložené v balení, samozrejme že sú k dispozícii aj samostatne. </P>
<H5>Obsah balenia monitora OPHERA </H5>
<UL>
    <LI>3 postranné kryty v 3 farbách
    <LI>1 interkom modul
    <LI>1 montážna krabica s príslušenstvom. </LI>
</UL>
<P>&nbsp;</P>');
<P>Tento rozmermi malý videotelefón určený pre zápustnú montáž môže byť namontovaný do štandardnej 3 až 6 modulovej inštalačnej krabice. Napriek svojím malým rozmerom 96 x 59 x 49,8 mm je NOVA moderný, elegantný a univerzálny produkt. </P>
<P>Jeho jednoduchá montáž, malé rozmery a možnosť výmeny rámčekov, ktoré je možné vybrať podľa okolitého nábytku, z neho robia atraktívny doplnok rôznych interiérov. Aktívny maticový farebný video modul zaisťuje čistý obraz zo všetkých uhlov pohľadu, dokonca i vo svetlých miestnostiach. Audio moduly poskytujú veľmi kvalitnú reprodukciu. Všetky ovládacie prvky sú diskrétne umiestnené na pravej strane monitora alebo hlasového modulu. </P>
<P>NOVA sa dodáva vo dvoch verziách – biela s antracitovým ovládaním alebo celá v antracitovej farbe.</P>
<P>Vyskúšajte si aké je to mať doma nainštalovanú NOVU. Navštívte stránku <A href="http://www.novabpt.com" target=_blank>www.novabpt.com</A> a skúste čo všetko dokáže. <STRONG>UPOZORNENIE</STRONG>: je to návykové, je možné, že po zhliadnutí tejto stránky už doma nebudete chcieť mať žiadny iný videotelefón.&nbsp; </P>
<P>&nbsp;</P>');
<P>LYNEA bola navrhovaná s využitím najprogresívnejších špičkových technológií. Je perfektným spojením technológie, dizajnu a ergonómie pri realizáciách vysoko kvalitných audio a video vstupných systémov. Skvelý systém s dokonalým obrazom a jednoduchou montážou. </P>
<H5>Jednoducho dokonalá, mimoriadne funkčná </H5>
<P>Elegantný vzhľad, inovovaný spôsob zavesenia slúchadla minimalizuje možnosť pádu, zaisťuje dokonalé a bezpečné zavesenie. </P>
<H5>Niekoľko modelov, maximálne flexibilné použitie</H5>
<P>Akékoľvek užívateľské požiadavky na audio video vrátnika&nbsp; je možné zaistiť pomocou niekoľko málo komponentov </P>
<H5>Vyberte si čo Vám vyhovuje </H5>
<P>LYNEA Vám poskytuje možnosť vybrať si či chcete používať len Audio alebo Video vrátnika, prípadne ich skombinovať. Pokiaľ sa rozhodnete pre obraz máte na výber dve verzie monitorov 4,5´´ čiernobiely alebo 3,5´´ farebný.&nbsp; <BR></P>');
<P>Kombináciou rôznych modulov vznikne prístroj s požadovanými vlastnosťami. </P>
<P><STRONG>EXEDRA je výsledkom</STRONG> vzájomného pôsobenia možností špičkovej technológie a požiadaviek na dizajn, ergonómie, ako aj výsledkom sociálnych a marketingových prieskumov </P>
<P><STRONG>EXEDRA je maximálne modulárny systém</STRONG>, jeho jednotlivé komponenty môžu byť vzájomne poskladané do rôznych kombinácií, tak aby bola dosiahnutá najlepšia kombinácia vyhovujúca individuálnym požiadavkám zákazníka. </P>
<P><STRONG>EXERDA je jednoduchý a praktický domový telefón</STRONG> so špeciálnou vidlicou, ktorá zabraňuje pádu slúchadla na zem </P>
<P><STRONG>EXEDRA je inteligentný telefón</STRONG>, s vlastnosťami moderných telefónov, ako hlasitý režim, opakované vytáčanie z pamäti, skrátené voľby a súčasne s funkciami domového telefónu. </P>
<P><STRONG>EXEDRA je aj monitor</STRONG>, kvalitný obraz a možnosť pripojenia externých kamier ho predurčujú pre&nbsp; využívanie aj ako malého dohľadového systému </P>
<P><STRONG>EXEDRA, multifunkčný prístroj</STRONG>, ktorý Vám umožní využívať súčasne funkcie vstupného video systému i komfortného telefónu </P>
<P><STRONG>EXEDRA je......</STRONG> presvedčte sa sami čo všetko tento systém pomocou rôznych modulov dokáže. <BR></P>');
<H5 align=left>Atraktívny vzhľad, mimoriadna odolnosť </H5>
<P align=left>Tento panel spája v sebe atraktívny vzhľad s pevnou konštrukciou. Jeho špeciálne technické vlastnosti (utesnené spoje, upevňovacie skrutky) zaisťujú vysokú odolnosť. </P>
<P align=left>Použité materiály – nerezová oceľ a 4 mm hrubý polykarbonát – zvyšuje jeho odolnosť proti narušeniu aj proti úderom.</P>
<H5 align=left>Nerozbitný </H5>
<P align=left>Kamerový kryt a kryty menoviek sú vyrobené z číreho polykarbonátu minimálnej hrúbky 4mm. Tento materiál ani časom nestráca svoju priehľadnosť a je prakticky nerozbitný.</P>
<H5 align=left>Montážne skrutky odolné proti demontáži nepovolanými osobami </H5>
<P align=left>Špeciálny tvar skrutiek vyžaduje k demontáži použitie špeciálneho nástroja, dodávaného s panelom. </P>
<H5 align=left>2 milimetre nerezovej ocele </H5>
<P align=left>Toto hrúbka nerezovej ocele antivandal vstupného panela. </P>
<H5 align=left>Bezpečné a pevné </H5>
<P align=left>Vyrobené z ocele, robustné tlačidlá odolné proti narušeniu, ich mechanická kvalita a špeciálny tvar neposkytujú žiadny priestor pre zasunutie akéhokoľvek cudzieho telesa.</P>
<H5 align=left>TARHGA – vystužený zápustný vstupný panel </H5>
<P align=left>Antivandal panel TARGHA&nbsp; môže byť inštalovaný do zvláštnej spevnenej krabice. Táto oceľová krabica je navrhnutá s jedinečnými vlastnosťami proti neoprávnenej demontáži a zaisťuje mimoriadnu odolnosť proti akýmkoľvek spôsobom napadnutia.&nbsp; </P>
<H5 align=left>Modularita ako forma funkčnosti </H5>
<P align=left>TARGHA je navrhnutá pre horizontálny alebo vertikálny spôsob montáže, táto vlastnosť umožňuje skĺbiť estetické požiadavky s priestorom ktorý je k dispozícii.&nbsp;</P>
<H5 align=left>Rozmery</H5>
<P align=left>208 x 99 x 22 mm&nbsp; <BR></P>
<P align=left><BR>&nbsp;</P>
<P align=left><BR>&nbsp;&nbsp; <BR></P>');
<H5 align=left>Elegancia v každom detaile </H5>
<P align=left>Vytvorením typickej dobovej a atmosféry môže mosadzný panel TARGHA pôsobiť ako vkusný doplnok inštalácií v štýle retro, ale rovnako je ním možné elegantne doplniť moderné komfortné exteriéry. </P>
<P align=left>Vzhľadom k stavebnicovej koncepcii a malým rozmerom, môže byť použitý aj pre blokové aplikácie. Jednotky vstupných panelov môžu byť zasekané do steny vedľa seba a osadené tlačidlovým panelom, audio alebo video panelom a presvetleným informačným modulom.</P>
<H5 align=left>Presvetlené alebo mosadzne menovky </H5>
<P align=left>Tradičné presvetlené menovky môžu byť vymenené za mosadzné s vygravírovaným menom.&nbsp; Balenie obsahuje obe možnosti. </P>
<H5 align=left>Montážne skrutky sú zabezpečené proti demontáži nepovolanými osobami </H5>
<P align=left>Špeciálny tvar skrutky vyžaduje k odmontovaniu panela použitie špeciálneho nástroja, dodávaného s panelom.</P>
<H5 align=left>Montáž viacerých panelov – vedľa seba </H5>
<P align=left>Mosadzné panely TARGHA sú navrhnuté len pre horizontálny spôsob montáže. </P>
<H5 align=left>Rozmery</H5>
<P align=left>208 x 99 x 22 mm</P>
