<P>Prezentácia bezdrôtovej zabezpečovacej ústredne TELETEK AVA:&nbsp; <STRONG><U><A href="http://dokumenty.inter.emm.sk/modules/fileDownload/?id=116">TU</A></U></STRONG></P>');
<P align=left>HOME SAPIENS je skupina systémov domácej automatizácie ktorá je odpoveďou na hľadanie komfortu pre Vašu domácnosť (kanceláriu, predajňu, showroom). Prečo by Vám mal rastúci počet technológii v domácnostiach komplikovať život? Ovládnite svetlo, zvoľte si romantickú scénu, skontrolujte prípadne nastavte teplotu v celej domácnosti, hrajte sa so žalúziami... a to všetko jedným dotykom. </P>
<P align=left>Vyložte si nohy a nechajte Vašu domácnosť rozmýšľať za Vás.</P>
<H5 align=left>Systém HOASIS plus je prvým článkom domácej automatizácie od spoločnosti BPT. </H5>
<P align=left>Ide o decentralizovaný modulárny systém, kde jednotlivé riadiace moduly komunikujú po zbernici.</P>
<UL>
    <LI>zbernica je vlastne jeden krútený pár vodičov, je nepolarizovaná, čím sa eliminuje možnosť výskytu chybového zapojenia
    <LI>moduly je možné osadiť do zapustených elektroinštalačných krabíc, alebo na DIN lištu do rozvádzača
    <LI>systém umožňuje ovládanie osvetlenia, markíz, žalúzií, riadenie vykurovania či chladenia, zavlažovania ...
    <LI>funkcie systému je možné naprogramovať priamo cez panel, alebo prostredníctvom PC, bez akýchkoľvek jumprov </LI>
</UL>
<P><STRONG>STIAHNITE SI NAŠU PREZENTÁCIU</STRONG>: <STRONG><A href="http://dokumenty.inter.emm.sk/modules/fileDownload/?id=122">TU </A></STRONG></P>
<P>A ak máte otázky týkajúce sa systému domácej automatizácie neváhajte nás kontaktovať na adrese:&nbsp; <A href="mailto:beno@inter.emm.sk"><STRONG>beno@inter.emm.sk</STRONG></A> <BR></P>');


